import React, { useState } from 'react';
import Modal from 'react-modal';
import RegistrationForm from './RegistrationForm';

const Header = () => {
    const [isRegistrationModalOpen, setIsRegistrationModalOpen] = useState(false);

    const openRegistrationModal = () => {
        setIsRegistrationModalOpen(true);
    };

    const closeRegistrationModal = () => {
        setIsRegistrationModalOpen(false);
    };

    return (
        <header className="header">
            <h1>Welcome to BargainHunter</h1>
            <nav className="nav">
                <ul>
                    <li><button onClick={() => console.log("Sell Items clicked")}>Sell Your Items</button></li>
                    <li><button onClick={() => console.log("Buy Items clicked")}>Buy Items</button></li>
                    <li><button onClick={() => console.log("List Home clicked")}>List Home</button></li>
                    <li><button onClick={openRegistrationModal}>Register</button></li>
                    <li><button onClick={() => console.log("Login clicked")}>Login</button></li>
                </ul>
            </nav>
            <Modal isOpen={isRegistrationModalOpen} onRequestClose={closeRegistrationModal}>
                <RegistrationForm onClose={closeRegistrationModal} />
            </Modal>
        </header>
    );
};

export default Header;
